import React, { Component } from 'react';
import { SocialIcon } from 'react-social-icons';

const socialStyle = {
  padding: '10px',
  backgroundColor: 'white'
};

const liStyle = {
  float: 'left',
  padding: '2px 5px',
};

const ulStyle = {
  display: 'inline-block',
  margin: '0',
  padding: '0'
};

const containerStyle = {
  textAlign: 'center'
};

class Footer extends Component {
	render() {
		return (
			<footer>
				<div className="container clearfix white" style={containerStyle}>
					<div className="col" id="col-1">
						<ul style={ulStyle}>
							<li style={liStyle}>
								<a href="/">Home</a>
							</li>
						</ul>
					</div>
					<div className="col" id="col-2">
          <ul style={ulStyle}>
              <li style={liStyle}>
								<a href="/Services">Services</a>
							</li>
						</ul>
					</div>
					<div className="col" id="col-3">
          <ul style={ulStyle}>
              <li style={liStyle}>
								<a href="/ContactUs">Contact Us</a>
							</li>
						</ul>
					</div>
					<div className="col" id="col-4">
          <ul style={ulStyle}>
              <li style={liStyle}>
								<a href="/AboutUs">About Us</a>
							</li>
						</ul>
					</div>
					<div>
						Follow Us On
						<div>
							<a style={socialStyle} href="/facebook">
								<SocialIcon network="facebook" />
							</a>
							<a style={socialStyle} href="/instagram">
								<SocialIcon network="instagram" />
							</a>
							<a style={socialStyle} href="/yelp">
								<SocialIcon network="yelp" />
							</a>
						</div>
					</div>
					<div id="copy">&#xa9; Designed and built by Team Atepex 2019</div>
				</div>
			</footer>
		);
	}
}

export default Footer;
